class VisualShaderNodeReroute(py4godot_visualshadernode.VisualShaderNode):
  r'''
		Automatically adapts its port type to the type of the incoming connection and ensures valid connections.
	'''

  @staticmethod
  def constructor():
    class_ = VisualShaderNodeReroute.construct_without_init()
    class_._ptr = constructor(939,0, ())
    return class_
  @staticmethod
  def new():
    class_ = VisualShaderNodeReroute.construct_without_init()
    class_._ptr = constructor(939,0, ())
    return class_
  def __init__(self):
    self._ptr =  CPPVisualShaderNodeRerouteWrapper()
    if c_utils.shouldCreateObject:
      self._ptr = constructor(939,0, ())


  def generate_wrapper(self):
    return CPPVisualShaderNodeRerouteWrapper()
  def init_signals(self):
    super().init_signals()

  @staticmethod
  def construct_without_init():
    cls = VisualShaderNodeReroute.__new__(VisualShaderNodeReroute)
    cls.shouldBeDeleted = True
    cls.init_signals()
    return cls
  @staticmethod
  def get_type():
    return 'VisualShaderNodeReroute'

  def __del__(self):
    pass
  @staticmethod
  def cast(other:'Object'):
    assert other != None # Object to be casted must not be None
    cls = VisualShaderNodeReroute.construct_without_init()
    cls._ptr = CPPVisualShaderNodeRerouteWrapper()
    cls._ptr_before = other._ptr # Save pointer
    cls._ptr.copy_gdowner(cls._ptr_before)
    cls.casted_from = other
    return cls
